  false,\n\t\"url\": null,\n\t\"notes\": \"This resource is available as a downloadable
  file, ESRI Service, and as a Web Feature service. Resource includes a Bedrock map,
  Structure map, Surficial map, and a text for the Bedrock geology of the Camels Hump
  Quadrangle, Vermont. For more information see links provided. Abstract: The rocks
  in the Camels Hump quadrangle were deposited in a Cambrian-Ordovician eugeosyncline
  principally as graywacke, siltstone and shale with minor amounts of quartzitic,
  volcanic and carbonaceous material. Units mapped are the Camels Hump group (Cambrian),
  consisting of the Pinnacle, Underhill, Hazens Notch and Pinney Hollow  formations,
  the Ottauquechee formation (Cambrian) and the Stowe formation (Ordovician). The
  lower part of the section is characterized by  coarser sediments, exemplified by
  the graywacke of the Pinnacle formation, and the upper part contains fine-grained
  and carbonaceous sediments exemplified by quartz-sericite schist and graphitic phyllite
  of the Hazens Notch and Ottauquechee formations.\",\n\t\"license_title\": null,\n\t\"extras\":
